import React from 'react';
import Select from 'react-select';
import 'rsuite/DateRangePicker/styles/index.css';
function Filter() {
	const options = [
		{ value: 'Krakow', label: 'Krakow' },
		{ value: 'Katowice', label: 'Strawberry' },
		{ value: 'Warszawa', label: 'Warszawa' },
	];
	return (
		<div className="flex justify-content-center text-black">
			<div className="bg-white w-3/4 h-[150px] rounded-xl flex justify-content-between align-items-center p-10 gap-1">
				<div className="w-full">
					<div className="text-black">FROM</div>
					<Select
						isMulti
						className="w-full "
						options={options}
						placeholder={'City, airport or country'}
						closeMenuOnSelect={false}
					/>
				</div>
				<div className="w-full">
					<div className="text-black">TO</div>
					<Select
						isMulti
						className="w-full "
						options={options}
						placeholder={'City, airport or country'}
						closeMenuOnSelect={false}
					/>
				</div>

				<div className="w-full">
					<div className="text-black">WHEN</div>
					<Select
						isMulti
						className="w-full "
						options={options}
						placeholder={'City, airport or country'}
						closeMenuOnSelect={false}
					/>
				</div>
				<button class="rounded-lg bg-[#c94f42] px-8 py-2  text-white outline-none hover:opacity-80 focus:ring">
					EXPLORE
				</button>
			</div>
		</div>
	);
}

export default Filter;
